import React, { Component } from 'react';
import  './styles.css';
// import { withRouter } from 'react-router';
import { connect } from "react-redux";
// import {checkStatus} from '../auth';
import ModalInfo from './Modal';
// import { debounce } from "../utils/debounce"
class Planets extends Component{

    constructor(props){
        super(props);
        this.state = {
            planets: [{name:'No Data Found'}],
            searchParam: '',
            filtered: this.props.data || [{ name: 'No Data Found' }],
            currPage: 1,
            searching:'no'
        }
    }

    static getDerivedStateFromProps = (props, state) => {
        const { userData, loginSuccess, history } = props;
        if (loginSuccess) { history.push("/planets")}
        return {
            name: userData.length ? userData[0].name : null
        };
    };

    componentDidMount(){
        this.setState({
            planets: this.props.data,
            filtered: this.props.data || [],
            showInfo:false
        });
    }

    filterList(event){
        // var updatedList = this.props.data.filter(function(item){
        //     return item.name.toLowerCase().search(event.target.value.toLowerCase()) !== -1;
        // });
        //this.setState({filtered:event.currentTarget.value?updatedList:[]});
      let [self, param] = [this, event.target.value.toLowerCase()];
      self.setState(
        {
          searching:'yes'
        }
      );
      this.props.searchAPlanet(param)

      // self.setState({
      //   filtered: this.props.data,
      //   searchParam: param
      // });
      .then(function(res){
        self.setState({ 
                  filtered: self.props.data ,
                  searchParam: param,
                  searching: 'no'
                });
      },function(){
        alert('No item found!!');
      });
    }
    lessItems(event){
       if(!event.currentTarget.value)this.setState({filtered:[]});
    }
    logouot(){
        // checkStatus.setLoggedIn = false;
        // this.props.history.push("/");
    }
    itemClicked(planet){
        this.setState({
            showInfo: true,
            planet: planet
        });
    }
    hideInfo(){
        this.setState({
            showInfo: false
        });
    }

    paginate(dir){
      let self = this;
      let inc = ( dir == 'next' )?1:-1;
      let page = parseInt(self.state.currPage, 0) + inc;
      self.setState(
        {
          searching: 'yes'
        }
      );
      this.props.searchAPlanet(this.state.searchParam + '&page=' + page).then(function () {
        self.setState({
          filtered: self.props.data,
          currPage: page,
          searching: 'no'
        });
      }, function () {
        alert('No item found!!');
      });
    }
    render(){
        const { name } = this.state;
        return(
            <div className="container">
                {this.state.showInfo?<ModalInfo planet={this.state.planet} hideInfo={this.hideInfo.bind(this)}/>:''}
                <div className="row">
                        <div className="col-md-12 userinfo">
                            Welcome: { name }<i className="fa fa-sign-out" aria-hidden="true" onClick={this.logouot.bind(this)}></i>
                        </div>
                </div>        
                <div className="row">
                    <div className="col-md-10 center">
                        <input type="text" className="form-control"
                         placeholder={this.props.data && this.props.data.length>0?'Search':'Loading...'} 
                         onKeyUp={this.filterList.bind(this)} onBlur={this.lessItems.bind(this)}/>
                    </div>
                 </div>
                     <div className="row">
                     <div className="col-md-10 center planet-list">
                         <div className={`list-group searching-${this.state.searching}`}>
                             {this.state.filtered.length>0 ? 
                                 (this.state.filtered.map((val,i)=>{
                                     let fontSize = {
                                         fontSize:(50+Number(val.diameter)/1e3)+'px'
                                     };
                                     let boundItemClick = this.itemClicked.bind(this, val);
                                     return <a href="#" className="list-group-item" key={i}
                                       style={fontSize} onClick={boundItemClick}>
                                        {val.name} <i className="fa fa-globe" aria-hidden="true">
                                        </i></a>;
                                 })
                                 ):''}
                         </div>
                         <ul className="pagination">
                            <li><a href="#" onClick={this.paginate.bind(this,'prev')}>Prev</a></li>
                            <li><a href="#" onClick={this.paginate.bind(this, 'next')}>Next</a></li>
                         </ul>
                     </div>

                  </div>
            </div>
        );
    }
}

export default connect((state) => {
    // const userData = state.get
    return {
        userData: state.userData,
        loginSuccess: state.loginSuccess
    }
})(Planets);
